class Form extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            name: ''
        }
    }
    handleNameChange(event){
        this.setState({
            name: event.target.value
        })
    }
    render() {
        return (
            <div className="Form">
                <form>
                    <label>
                        Name:
                 <input type="text" onInput="this.handleNameChange"/>
                    </label>
                    <input type="submit" value="Submit" />
                </form>
            </div>
        );
    }
}
export default Form;
